package yundong

import (
    "encoding/hex"
    "fmt"
    "testing"
    "time"
)

func TestParseCabinetData(t *testing.T) {
    tz := "Asia/Shanghai"
    loc, _ := time.LoadLocation(tz)
    time.Local = loc

    b, _ := hex.DecodeString("")
    p := New()
    str := p.CabinetData("NCAWDFB1N751S122", b)
    fmt.Println(str)
}
